import React from 'react';
import './Main.css';

function Main() {

  return (
    <main className="main-container">
          <div className="main-image-wrap">
              <div className='main-image main-image1'><img src="../../public/images/main/main1-1.jpg"></img></div>
              <div className='main-image main-image2'><img src="../../public/images/main/main1-2.jpg"></img></div>
              <div className='main-image main-image3'><img src="../../public/images/main/main1-3.jpg"></img></div>
              <div className='main-image main-image4'><img src="../../public/images/main/main1-4.jpg"></img></div>
              <div className='main-image main-image5'><img src="../../public/images/main/main1-5.jpg"></img></div>
              <div className='main-image main-image6'><img src="../../public/images/main/main1-6.jpg"></img></div>
          </div>
    </main>
  );
}

export default Main;
